Text:
@adatinis,

This is not the place for computer related help, but i will help you anyways.

I would recommend downloading a bootable copy of linux, using it to copy all your important files to another location. Then have them scanned and cleaned via another computer with updated antivirus. Then reinstall your computer and all your programs and put your important files back on. And don't forget to make regular backups to at least 2 locations.
